Les langues austronésiennes (AN) sont parlées à Madagascar, en Asie du Sud-Est, dans l'océan Pacifique et à Taïwan. Au nombre de 1 268[réf. nécessaire], elles constituent la 2e famille de langues du monde après celle des langues nigéro-congolaises. Les langues austronésiennes se répartissent en deux grandes catégories, les langues formosanes (ensemble géographique non-génétique), qui consistent en 9 branches, et la branche des langues malayo-polynésiennes (MP). Comme les premières ont été tardivement classées, pendant longtemps les deux termes, AN et MP, ont pu être confondus. Le foyer d'origine de toutes ces langues semble être l'extrémité sud-est de la Chine du Sud ou Formose (Taïwan) où vivent encore aujourd'hui des populations austronésiennes. Typologiquement, ces langues se distinguent par deux procédés morphologiques qui permettent la formation de mots dérivés et peuvent être combinés : 
* l'affixation, par l'adjonction de préfixes, suffixes, infixes et circumfixes (combinaison d'un préfixe et d'un suffixe) à une base ; 
* la réduplication, ainsi que par des systèmes phonologiques relativement simples (peu de consonnes et de voyelles, peu voire pas du tout de groupes de consonnes difficiles à prononcer, énoncés assonancés, etc.).
